import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className='app__navbar'>
      <div className='app__navbar-logo'>HONBAM</div>
      <ul className='app__navbar-logo'>
        <li className='p__hotplace'>HOTPLACE</li>
      </ul>
    </nav>
  );
};

export default Navbar;
